export const generateGUID = () => {
	function s4() {
    	return Math.floor((1 + Math.random()) * 0x10000).toString(16).substring(1);
  	}
  	
  	return s4() + s4() + '-' + s4() + '-' + s4() + '-' + s4() + '-' + s4() + s4() + s4();
}

export const buildRequest = (method, url, headers, params, payload) => {
	params = (params === undefined) ? '' : params;
	var request = {
			method  : method,
			body    : payload,
			headers : headers
	};

	if (url.indexOf('proxy') > -1) {
		request['mode'] = 'no-cors'
	}

	return new Request(
		url + params, 
		request
	)
}

export const buildInstance = () => {
	var elements = location.hostname.split("."),
		instance = '';

	if (elements.length === 4 && elements[1] === 'my') {
        instance = elements[0] + '.' + elements[1];
    } else if (elements.length === 3) {
        instance = elements[0];
    } else {
        instance = elements[1];
    }

    return instance;
}

export const buildParams = (params) => {
	if (params) {
		var urlPath 	= '',
			paramLength = Object.keys(params).length,
			index 		= 0
		
		for (var property in params) {
			if (params.hasOwnProperty(property)) {
				index++
				urlPath += property + '=' + params[property]
				urlPath += (index < paramLength) ? '&' : ''
			}
		};

		return (urlPath.length > 0) ? ('?' + urlPath) : ''
	} else {
		return ''
	}
}

