		case CONSTANTS.CREATE_GRAPH:
			return ajax.postApexREST(action.sessionId, params, { 
					'reportId' : action.reportId, 
					'graphId'  : action.graphId
				}).then(function(response) {
			    	next(
			    		parseResponse(
			    			response, 
			    			CONSTANTS.CREATE_GRAPH_ERROR, 
			    			CONSTANTS.CREATE_GRAPH_COMPLETE
			    		)
			    	)
				})

			break
		case CONSTANTS.UPDATE_GRAPH:
			return ajax.putApexREST(action.sessionId, params, { 
					'id'       : action.id ,
					'reportId' : action.reportId,
					'graphId'  : action.graphId
				}).then(function(response) {
			    	next(
			    		parseResponse(
				    		response, 
				    		CONSTANTS.UPDATE_GRAPH_ERROR, 
				    		CONSTANTS.UPDATE_GRAPH_COMPLETE
				    	)
			    	)
				})

			break
		case CONSTANTS.LOAD_GRAPHS:
			return ajax.fetchApexREST(action.sessionId, params)
				.then(function(response) {
			    	next(
			    		parseResponse(
				    		response, 
				    		CONSTANTS.LOAD_GRAPHS_ERROR, 
				    		CONSTANTS.LOAD_GRAPHS_COMPLETE
				    	)
			    	)
				})
			
			break
		case CONSTANTS.REFRESH_GRAPH:
			debugger
			return ajax.fetchApexREST(action.sessionId, params)
				.then(function(response) {
			    	next(
			    		parseResponse(
				    		response, 
				    		CONSTANTS.REFRESH_GRAPH_ERROR, 
				    		CONSTANTS.REFRESH_GRAPH_COMPLETE
				    	)
			    	)
				})
			
			break
		case CONSTANTS.LOAD_GRAPH_TYPES:
			return ajax.fetchApexREST(action.sessionId, params)
				.then(function(response) {
			    	next(
			    		parseResponse(
				    		response, 
				    		CONSTANTS.LOAD_GRAPH_TYPES_ERROR, 
				    		CONSTANTS.LOAD_GRAPH_TYPES_COMPLETE
				    	)
			    	)
				})
			
			break
		case CONSTANTS.DELETE_GRAPH:
			return ajax.deleteApexREST(action.sessionId, params)
				.then(function(response) {
			    	next(
			    		parseResponse(
				    		response, 
				    		CONSTANTS.DELETE_GRAPH_ERROR, 
				    		CONSTANTS.DELETE_GRAPH_COMPLETE
				    	)
			    	)
				})

			break
		default:
			break
	}

	switch(action.type) {
		case CONSTANTS.LOAD_REPORTS:
			return ajax.fetchReportAPI(endpoint, action.sessionId)
				.then(function(response) {
			    	next(
			    		parseResponse(
				    		response, 
				    		CONSTANTS.LOAD_REPORTS_ERROR, 
				    		CONSTANTS.LOAD_REPORTS_COMPLETE
				    	)
			    	)
				})

			break
		case CONSTANTS.RETRIEVE_REPORT_DATA:
			endpoint = CONSTANTS.REPORT_API_QUERY

			return ajax.postReportAPI(endpoint, action.sessionId, { 
					reportMetadata : action.metadata 
				}).then(function(response) {
					let actionObj = parseResponse(
			    		response, 
			    		CONSTANTS.RETRIEVE_REPORT_DATA_ERROR, 
			    		CONSTANTS.RETRIEVE_REPORT_DATA_COMPLETE
			    	)

			    	actionObj.reportId = action.reportId

			    	next(actionObj)
				})

			break		
		case CONSTANTS.RETRIEVE_REPORT_METADATA:
			endpoint = action.reportId + CONSTANTS.REPORT_API_DESCRIBE

			return ajax.fetchReportAPI(endpoint, action.sessionId)
				.then(function(response) {
					let actionObj = parseResponse(
			    		response, 
			    		CONSTANTS.RETRIEVE_REPORT_METADATA_ERROR, 
			    		CONSTANTS.RETRIEVE_REPORT_METADATA_COMPLETE
			    	)

			    	actionObj.reportId = action.reportId

			    	next(actionObj)
				})

			break
		default:
			break
	}
}

const parseResponse = (response, nextErrorAction, nextActionToTake) => {
	const data 		 = JSON.parse(response.text)
	let   nextAction = nextActionToTake

	if (response.status !== 200) {
		nextAction = nextErrorAction
	}
	
	console.log('Next Action:: ' + nextAction)
	console.log(data);

	return {
		type : nextAction,
		data
	}
}

