	switch (action.type) {
		case CONSTANTS.LOAD_GRAPHS_COMPLETE:
			return action.data
		case CONSTANTS.REFRESH_GRAPH_COMPLETE:
			return state.map((graph) => updateGraph(graph, action))
		default:
			return state
	}
}

const updateGraph = (state = {}, action) => {
	const data = action.data

	if (data && data.length > 0) {
		const graph = data[0]

		if (graph.Id == state.Id) {
			return graph
		}
	}

	return state
}

